  const attr2 = req.query.attr2;
  const attr3 = req.query.attr3;
  try{
    const lett = new Let({
      content: art,
      title: tit,
      texture: tex,
      attr1: attr1,
      attr2: attr2,
      attr3: attr3,
    })
    lett.save().then(result => {
      console.log('note saved!')
    })
    saveTitle("");
    saveTexture("classic");
    saveArt("");
      res.json({msg: "success"});
  }catch(e){
      res.status(406).send({ msg: 'Fail' })
  }
}
)

export default router;

